import logo from './logo.svg';
import './App.css';
import {BrowserRouters,Routes,Route } from 'react-router-dom';
import Login from '../src/Login/Login';
import Fstpage from '../src/ftpage/Fstpage';
import Navbar from './Navbar/Navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouters>
      <Routes>
        <Route path='/navbar'
        element={
          <>
          <Navbar/>
          </>
        }>
        </Route>
      </Routes>
      </BrowserRouters>
    </div>
  );
}

export default App;
